import React, { useEffect, useState } from 'react';
import EmptyView from '../../components/common/EmptyView';
import List from '../../components/Home/List';
import './styles.css';
import FacebookIcon from '@mui/icons-material/Facebook';
import HomeIcon from '@mui/icons-material/Home';
import ShuffleIcon from '@mui/icons-material/Shuffle';
import LoginIcon from '@mui/icons-material/Login';
import HowToRegIcon from '@mui/icons-material/HowToReg';
import SettingsIcon from '@mui/icons-material/Settings';
import MenuIcon from '@mui/icons-material/Menu';
import ExpandLessIcon from '@mui/icons-material/ExpandLess';
import WhatshotIcon from '@mui/icons-material/Whatshot';

import { Routes,Route, Link, BrowserRouter} from "react-router-dom";
import Divider from "@material-ui/core/Divider";

const Random = () => {

    const instance = {
        baseURL: `http://127.0.0.1:8081`
    }
    const requests = {
        fetchTypes: `/type`,
        fetchNations: `/nation`,
        fetchReceipts: `/recept`,
        fetchReceiptIngredient: `/recept/ingredient`,
        fetchIngredient: `/ingredient`,
        fetchRandom:`/recept/random`,

    }
    const [randomList, setRandomList] = useState([]);
    const [type_receipts, setTypeofDish] = useState([]);

    const [ingList, setIngList] = useState([]);

    const [nations, setNation]= useState([]);

    async function fetchTypes() {
        const data = await fetch(`${instance.baseURL}${requests.fetchTypes}`);
        const res = await data.json();
        setTypeofDish(res);
    }


    async function fetchNations() {
        const data = await fetch(`${instance.baseURL}${requests.fetchNations}`);
        const res = await data.json();
        setNation(res);
    }


    async function fetchIngredient() {
        const data = await fetch(`${instance.baseURL}${requests.fetchIngredient}`);
        const res = await data.json();
        setIngList(res);
    }
    async function fetchRandom() {
        const data = await fetch(`${instance.baseURL}${requests.fetchRandom}`);
        const res = await data.json();
        setRandomList(res);
    }
    useEffect(() => {

        fetchNations();
        fetchTypes();
        fetchIngredient();

        fetchRandom();
    }, []);




    const handleRandom = () => {
        fetchRandom();
    };

  return (


        <div className='home'>
            <div className='parent'>
                <div className="wrapper">
                    <input type="checkbox" id="btn" hidden />
                    <label htmlFor="btn" className="menu-btn">
                        <MenuIcon />
                        <ExpandLessIcon />
                    </label>
                    <nav id="sidebar">
                        <div className="title">Receipt Menu</div>

                        <ul className="list-items">
                            <li>
                                <h1>Main</h1>
                            </li>
                            <li>
                                <Link to="/">
                                    <HomeIcon />
                                    Home
                                </Link>
                            </li>
                            <li>
                                <Link to="random">
                                    <ShuffleIcon />
                                    Random Receipts
                                </Link>
                            </li>
                            <li>
                                <Link to="trend">
                                    <WhatshotIcon />
                                    Trending
                                </Link>
                            </li>
                            <li>
                                <h1>Account</h1>
                            </li>

                            <li>
                                <a href="login">
                                    <LoginIcon />
                                    Login
                                </a>
                            </li>
                            <li>
                                <a href="register">
                                    <HowToRegIcon />
                                    Register
                                </a>
                            </li>
                            <li>
                                <h1>Service</h1>
                            </li>
                            <li>
                                <a href="setting">
                                    <SettingsIcon />
                                    Setting
                                </a>
                            </li>

                            <div className="icons">
                                <a href="#" aria-label="Facebook">
                                    {" "}
                                    <FacebookIcon />
                                </a>
                                <a href="#" aria-label="twitter">
                                    <FacebookIcon />
                                </a>
                                <a href="#" aria-label="Github">
                                    <FacebookIcon />
                                </a>
                                <a href="#" aria-label="youtube">
                                    <FacebookIcon />
                                </a>
                            </div>
                        </ul>

                    </nav>
                </div>


            </div>
            <button className="glow-on-hover" onClick={handleRandom} type="button">Apply Sorting</button>

            <div className='home_panelList-wrap'>
                {/* Filter Panel */}

                <div className='home_panel-wrap'>

                </div>
                {/* List & Empty View */}
                <Divider orientation="vertical" flexItem></Divider>

                <div className='home_list-wrap'>
                    {randomList ? <List list={randomList}  type_receipts={type_receipts} nations={nations} ingList={ingList}/> : <EmptyView />}
                </div>
                <Divider orientation="vertical" flexItem></Divider>


            </div>
            <button className="glow-on-hover" onClick={handleRandom} type="button">Apply Sorting</button>

        </div>
    );
};


export default Random;
